import React, { useEffect, useState } from 'react';
import { Card } from 'react-bootstrap';
import ReportService from '../../service/report.service';

import Moment from 'react-moment';
import 'moment-timezone';


const CardLastReport = () => {

    const [reports,setReports] = useState([]);

    useEffect(()=>{
        ReportService.fetchLastReportOfRegion().then(
            (response)=>{
                setReports(response)
            }
        );
    },[]);

    return (
        reports.map((report, index) =>
            <div key={index} className="card-top-players">
                <Card >
                    <Card.Body>
                        <Card.Title className="title-top-player">
                            <div className='d-inline'>{report.description}</div>
                            <div className='d-inline rep-count ml-2'>{report.reportType}</div>
                        </Card.Title>
                        <div className="text-top-player">
                            <p>Date : <Moment format="YYYY/MM/DD">{report.date}</Moment></p>
                        </div>
                    </Card.Body>
                </Card>
                <br />
            </div>
        )
    );

};
export default CardLastReport;
